import {FaShoppingCart} from "react-icons/fa";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return <div className="flex justify-between">

    <NavLink to='/'>
    <img src="https://codehelp-shopping-cart.netlify.app/logo.png" />
    </NavLink>
    <div>
      <NavLink to="/">
        Home
      </NavLink>
      <NavLink to="/cart">
        <FaShoppingCart/>
      </NavLink>
    </div>
  </div>;
};

export default Navbar;
